import React from "react";
import { Marker, Popup} from 'react-leaflet'
import { Property} from "../../../../generated/graphql";


interface Props {
     property: Property
}

export const MapMarkerProperty: React.FC<Props> = (Props) => {

    const property = Props.property;

   return (
        <Marker
            key={property.id}
            position={[
                property.lat,
                property.long
            ]}
        >
            <Popup>test</Popup>
        </Marker>    )
}
